Exorcising Mexico's Demons

Sociopolitical Documentary hosted by Vladimir Hernandez, published by BBC broadcasted as part of BBC Our World series in 2013 - English narration


Information
------------------------------

Vladimir Hernandez reports on how Roman Catholic priests in Mexico are turning to exorcism to fight the gruesome drug-related violence that is engulfing the country.

